import React from "react";
import styled from "styled-components";

const Nav = () => {
  return (
    <>
      <NavContainer>
        <span>Wanted Pre-onboarding course</span>
      </NavContainer>
    </>
  );
};

export default Nav;

const NavContainer = styled.div`
  height: 80px;
  display: flex;
  align-items: center;
  padding-left: 50px;
  font-style: italic;
  font-weight: bolder;
  border-bottom: 1px solid lightgray;
  position: sticky;
  background-color: white;
  span {
    font-size: 26px;
  }
`;
